import styles from "./order-tetails.module.css"
import { CloseIcon } from "@ya.praktikum/react-developer-burger-ui-components";

function OrderTetails() {
return (
    <template className={`${styles.templ}}`}>
        <div className={`p-10 ${styles.ingrCont}`}>
            <div className={`mt-4 mb-6 ${styles.headCont}`}>
                <h3 className="text text_type_main-large"></h3>
                <CloseIcon type="primary"/>
            </div>
            <h2></h2>
        </div>
    </template>
)
}

export default OrderTetails
